import React from 'react';
import { Link } from 'react-router-dom';
import './HomePage.css';

function HomePage() {
  return (
    <div className="home-container">
  <div className="home-box">
    <h1>Welcome to the Cybersecurity Ransomware Quiz</h1>
    <p>Learn how ransomware affects the healthcare industry and test your knowledge to improve your cybersecurity awareness.</p>
    <button onClick={() => navigate('/quiz')}>Start Quiz</button>
    <button onClick={() => navigate('/info')}>Learn More</button>
  </div>
</div>

  );
}

export default HomePage;
